    "description": "Are you driven by the excitement of unraveling intricate data puzzles? Does your DNA resonate with collaborative problem-solving? Do you thrive on witnessing the ripple effects of your contributions in the larger scheme of things? If you've nodded along to any of these questions, welcome to Amazon PeopleInsights eXperience (APIX) team! We're not just a team; we're a dynamic cohort of engineers dedicated to leveraging innovations for Amazon's PXT Business Analytics tools and software. Together, we confront tangible challenges head-on, poised to revolutionize customer experiences in unforeseen ways. Every day, we embark on a journey of invention, pioneering fresh solutions that shape tomorrow's landscape.<br/><br/>As part of Amazon PeopleInsights eXperience (APIX) team  at Amazon, you will be part of the Data team that builds the foundational data infrastructure and analytics tools for people analytics capabilities. We create secure, scalable PXT LakeHouse solutions that enable teams across PXT to access and analyze data effectively while maintaining data integrity. In this role, you will design, build, and maintain scalable data pipelines and infrastructure, collaborate with product managers, business intelligence engineers, and HR business partners to transform complex HR Ops, experience and engagement  data into actionable insights that drive Amazon's people strategy. Your technical expertise will help us make data-driven decisions that enhance the employee experience across Amazon's global workforce.<br/><br/>Key job responsibilities<br/>Key job responsibilities<br/>In this role you will:<br/>* Design and implement high performant and cost-efficient data lake infrastructure using AWS big data stack, Spark, Hive, SQL, Apache Airflow, AWS Glue, EMR, S3, Redshift and OLAP technologies.<br/>* Collaborate with Business Intelligence Engineers to recognize and help adopt best practices in building semantic layers  in reporting and analysis, optimize SQL queries for fast, cost-efficient access.<br/>* Follow software best practices including coding standards, code reviews, and testing for all related data processing systems.<br/>* Work directly with customers to integrate new data types, curate data profiles,  perform data quality checks and incorporate feedback.<br/>* Empower technical and non-technical, internal customers to drive their own analytics and reporting (self-serve reporting) and support ad-hoc data generation and reporting when needed.<br/>* Be comfortable with a degree of ambiguity and willing to develop quick proof of concepts, iterate and improve<br/>* Actively support and foster a culture of inclusion.<br/><br/>A day in the life<br/>Successful candidate should have experience working with big data, building data lakes and data processing services, experience with one or more query language (e.g., SQL, PL/SQL, HiveQL, SparkSQL) and scripting language (e.g., Python, Scala). They are effective at seeing data patterns and building generic data solutions to improve user experience.<br/><br/>About the team<br/>The Amazon People Insights team transforms the creation and delivery of actionable, people-centric insights for HR, Operations, and corporate leaders across Amazon - empowering efficient, data-driven, and timely workforce decisions aligned with Amazon\u2019s objective to be Earth\u2019s Best Employer. ",
