    "basic_qualifications": "- 5+ years of non-internship professional software development experience<br/>- 5+ years of programming with at least one software programming language experience<br/>- 5+ years of leading design or architecture (design patterns, reliability and scaling) of new and existing systems experience<br/>- Experience as a mentor, tech lead or leading an engineering team",
